solvewithbasis{T1,T2,T3,T4}(task:: MSKtask,transp:: T1,numnz:: T2,sub:: Array{T3},val:: Array{T4}) = solvewithbasis(task,Int32(transp),Int32(numnz),convert(Array{Int32},sub),convert(Array{Float64},val))
function solvewithbasis(task_:: MSKtask,transp_:: Int32,numnz_:: Int32,sub_:: Array{Int32},val_:: Array{Float64})
  __tmp_var_0 = [ numnz ]
  __tmp_var_1 = getnumcon(task_)
  if length(sub_) < __tmp_var_1
    println("Array argument sub is not long enough")
    throw(BoundsError())
  end
  __tmp_var_2 = getnumcon(task_)
  if length(val_) < __tmp_var_2
    println("Array argument val is not long enough")
    throw(BoundsError())
  end
  res = disable_sigint() do
    @msk_ccall( "solvewithbasis",Int32,(Ptr{Void},Int32,Ptr{Int32},Ptr{Int32},Ptr{Float64},),task_.task,transp_,__tmp_var_0,sub_ .- 1,val_)
  end
  if res != MSK_RES_OK
    msg = getlasterror(task_)
    throw(MosekError(res,msg))
  end
  (__tmp_var_0[1])
end

